        public string County { get; set; }
        public string PostalCode { get; set; }

        private static Dictionary<string, StreetData> _dataFromOpenPostcodeDatabase = null;

        internal static StreetData FindPostalCode(string postalCode)
        {
            System.Threading.Thread.Sleep(postalCode.Length * 200);

            if (_dataFromOpenPostcodeDatabase == null) { PopulateLookup(); }

            if (_dataFromOpenPostcodeDatabase.ContainsKey(SearchablePostalCode(postalCode)))
                return _dataFromOpenPostcodeDatabase[SearchablePostalCode(postalCode)];
            else
                return new StreetData();
        }

        private static string SearchablePostalCode(string postalCode)
        {
            return postalCode.Replace(" ", "").ToLower();
        }

